
// https://lpgithub.dev.lprnd.net/Architecture/api-ums/blob/master/api-ums-cm/src/main/java/com/liveperson/api/ams/cm/types/DialogType.java

/**
 * @typedef {string} DialogType
 */

/**
 * The dialog type, all conversations will have a MAIN dialog, others are optional. Only one dialog can be active at a time.
 * @enum {DialogType}
 * @category Conversation
 */
const DialogType = {
    MAIN: 'MAIN',
    AGENTS: 'AGENTS',
    OTHER: 'OTHER',
    POST_SURVEY: 'POST_SURVEY',
    PRE_CONVERSATION_OPT_IN: 'PRE_CONVERSATION_OPT_IN'
};

module.exports = DialogType;
